        private static List<Dictionary<UnitType, int>> ReqUnitsInit()
        {
            var req = new List<Dictionary<UnitType, int>>();

            // Add the whatBuilds types to the required units map
            foreach (UnitType unitType in Enum.GetValues(typeof(UnitType)))
            {
                req.Add(new Dictionary<UnitType, int>());
                Pair<UnitType, int> wb = unitType.WhatBuilds();
                if (wb.GetKey() != UnitType.None)
                {
                    req[(int)unitType].Add(wb.GetKey(), wb.GetValue());
                }
            }

            req[(int)UnitType.Terran_Ghost].Add(UnitType.Terran_Academy, 1);
